def geturl(text):
    out = "https://hub.spigotmc.org/javadocs/bukkit/org/bukkit/"
    package = True
    if text == None:
      print(out + "overview-summary.html")
      sys.exit()
    if not "." in text:
      package = False

    if package == True:
      a = text.split(".")
      b = a[len(a)-1].istitle()
      if b:
        out += "/".join(a) + ".html"
      else:
        out += "/".join(a) + "/package-summary.html"
    else:
      inp = text.split(' ')[0]
      try:
        inp = inp[0].upper() + inp[1:]
      except IndexError:
        out = "Usage: .bukjd ClassName / package.name"
        inp = None
      try:
        out = "https://hub.spigotmc.org/javadocs/%s/" % text.split(' ')[1]
      except IndexError:
        pass
      if inp in classes:
        out += classes[inp].replace("org/bukkit/", "")
      elif inp:
        keys = classes.keys()
        import difflib
        closenames = difflib.get_close_matches(inp, keys, 1)
        if len(closenames) == 1:
          out += classes[" ".join(closenames)].replace("org/bukkit/", "")
        else:
          out = "No results."
    return out


@hook.command
def bukjdm(text):
    text = text.lower()
    if text in methods:
        out = []
        for i in methods[text]:
            url = geturl(i)
            if not url in out:
                out.append(url)
        if len(out) > 3:
            data = web.Hastebin("\n".join(out))
            return "%s can be found in: %s %s %s and %s other places: %s" % (text, out[0], out[1], out[2], len(out) - 3, data)
        else:
            return "%s can be found in: " % text + " ".join(out)
    else:
        import difflib
        closenames = difflib.get_close_matches(text, methods, 3)
        if len(closenames) >= 1:
            return "Did you mean: " + ", ".join(closenames)
        else:
            return "No results."

@hook.command
def bukjd(text):
    return geturl(text)
